package sphincsplus_256s

import (
	"encoding/hex"
	"testing"

	"github.com/theQRL/go-qrllib/crypto/sphincsplus_256s/params"
)

const (
	expectedPK = "1d72a342d764d879ca4bf028064ff0b8f578c41bce0f52ed588dfe615d8d4a5cd824360629d606b24f0dbc677a89c05fb9912e146bc0b9d212d2506f571cbcea"
	expectedSK = "816af0680147304a37f2188941b90b04286622dc48381a720f95e3cf043132da2c19c010a7bf8aabbe799509a2413aba3bc0832575cddad6c4e4fa108b5d45121d72a342d764d879ca4bf028064ff0b8f578c41bce0f52ed588dfe615d8d4a5cd824360629d606b24f0dbc677a89c05fb9912e146bc0b9d212d2506f571cbcea"
	message    = "ed3bead44dc0a0c0a0c1052a91372f1e93f49a76cc0a1e76dd2b39f73b8af88c"
	optRandStr = "efec42e71cfe44ccb8100e10b7012a116203bb7ccbce6ebccc23573d07904f3900671a1cbbe7564c10731a1f90342fc5a6ac617e9fbe8b1997789cb0cc5371cbe6dbc0507eec04"
	expectedSM = ""
)

func genOptRandFunc(optRand []byte) error {
	binOptRand, err := hex.DecodeString(optRandStr)
	if err != nil {
		return err
	}
	copy(optRand, binOptRand)
	return nil
}

func TestCryptoSignKeypair(t *testing.T) {
	pk := make([]byte, params.SPX_PK_BYTES)
	sk := make([]byte, params.SPX_SK_BYTES)
	unSizedSeed, err := hex.DecodeString("816af0680147304a37f2188941b90b04286622dc48381a720f95e3cf043132da2c19c010a7bf8aabbe799509a2413aba3bc0832575cddad6c4e4fa108b5d45121d72a342d764d879ca4bf028064ff0b8f578c41bce0f52ed588dfe615d8d4a5c")
	if err != nil {
		t.Error(err)
	}

	var seed [96]byte
	copy(seed[:], unSizedSeed)

	if err := cryptoSignKeypair(pk, sk, seed); err != nil {
		t.Error(err)
	}
	if hex.EncodeToString(pk) != expectedPK {
		t.Error("pk mismatch")
	}
	if hex.EncodeToString(sk) != expectedSK {
		t.Error("sk mismatch")
	}
	m, err := hex.DecodeString(message)
	if err != nil {
		t.Error(err)
	}
	sm, _ := cryptoSign(m, sk, genOptRandFunc)
	if hex.EncodeToString(sm) != expectedSM {
		t.Error("sm mismatch")
	}
	if cryptoSignOpen(m, sm, pk) != true {
		t.Error("cryptoSignOpen failed")
	}
}
